import React from "react";
import "../App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { ListItemCardData } from "./ListItemCardData";
import { CardData } from "./CardData";
import { ReactComponent as GiftIcon } from "../assets/icons/gift.svg";
import { ReactComponent as NextIcon } from "../assets/icons/next.svg";

import {
  Container,
  Row,
  Col,
  Card,
  ListGroup,
  ListGroupItem,
} from "react-bootstrap";

function Cards() {
  return (
    <>
      <style type="text/css">
        {`
     .col {
      width: 343px
      }

     .row>* {
       padding-right: 43px;
       padding-left: 0;
      }

  .card {
    border-radius: 4px 20px 20px 20px;
    border: 0px;
    box-shadow: 0px 10px 20px rgba(233, 216, 207, 0.3);
    width: auto;
    height: 548px;
    
  }
  .card>.list-group:last-child {
    border-radius: 20px
  }

    .card-header  {
        color: #272931;
         background-color: #ffffff;
         height: 60px;
         border: 0px;
         justify-content: center;
         align-items: center;
      }

      .card-header:first-child {
        border-radius:  20px;
      }

    `}
      </style>
      <Row xs={1} md={2} className="g-4">
        <Col>
          {CardData.map((props, key) => {
            return (
              <Card key={key}>
                <Card.Header className="bg">
                  {props.iconHeader}
                  <span>{props.titleHeader}</span>
                  <span>{props.status}</span>
                </Card.Header>
                <Card.Img variant="top" src={props.image} />
                <Card.Body>
                  <Card.Title>{props.title}</Card.Title>
                  <Card.Text>
                    <GiftIcon />
                    {props.giftTitle}
                  </Card.Text>
                </Card.Body>
                {ListItemCardData.map((val, key) => {
                  return (
                    <ListGroup key={key} className="list-group-flush">
                      <ListGroupItem>
                        {val.item1}
                        <span>{props.item1}</span>
                        <NextIcon />
                      </ListGroupItem>
                      <ListGroupItem>
                        {val.item2}
                        <span>{props.item2}</span>
                        <NextIcon />
                      </ListGroupItem>
                      <ListGroupItem>
                        {val.item3}
                        <span>{props.item3}</span>
                      </ListGroupItem>
                      <ListGroupItem>
                        {val.item4}
                        <span>{props.item4}</span>
                      </ListGroupItem>
                    </ListGroup>
                  );
                })}
              </Card>
            );
          })}
        </Col>
      </Row>
    </>
  );
}

export default Cards;
